import React, { Component } from 'react'

class Money extends Component {
    constructor() {
        super();
        this.state = {
            money: "8 007"
        }
    }
    render() {
        return (
            <p>Studying full time (100%) will give you {this.state.money} SEK.</p>
        )

    }
}

export default Money
